B.FN=s(["Developed automated ETL scripts using Python and PostgreSQL to collect, clean, and consolidate leasing and occupancy data from multiple branches and property management systems.","Built dynamic dashboards for occupancy tracking, lease renewal forecasting, and period-over-period comparisons, improving decision-making for property managers and finance teams.","Integrated visualization layers using Plotly and Power BI for interactive insights into occupancy rates, vacant spaces, and utilization efficiency across portfolio segments.","Implemented data validation pipelines to ensure accuracy of tenant records, lease terms, and occupancy calculations before generating analytics summaries.","Created APIs and background jobs to sync lease records with accounting and facility management systems for end-to-end operational transparency.","Collaborated with business stakeholders to define KPIs such as occupancy percentage, average lease duration, renewal rates, and revenue per square meter.","Designed an intuitive filtering system that allows users to view occupancy statistics by branch, region, lease type, or specific reporting period.","Enhanced performance through database indexing and optimized query aggregation, enabling faster report generation for high-volume datasets.","Provided training materials and support for operational teams to interpret dashboard insights and leverage data for strategic space optimization."],t.s)
