B.Ke=new A.f8("Transnet Properties Integrated Leases Review","The TP Integrated Leases Review system was developed to analyze, visualize, and optimize property occupancy statistics across multiple facilities and reporting periods. The platform consolidates lease data, occupancy rates, and tenant metrics into interactive dashboards that empower real estate teams to make informed, data-driven decisions.","Power BI Developer & Data Analyst",B.FN,B.Gp,"assets/assets/lease_agreement.jpeg")
